import React from 'react';
import '../css/Header.css';
import '../App.css';
import '../css/Header.css'


function Header() {
    return (
        <div className="header">
            <a className="header__link" href="#">
                <div className="header__logo">osep-schemes</div>
            </a>
        </div>
    );
}

export default Header;
